import axios from 'axios';
import ReactDOM from 'react-dom';
import '../index.css'

class Homepage extends Component {

  componentDidMount() {
    this.effect = window.VANTA.BIRDS({
      el: "#my-element",
      backgroundColor: 0xd2d8e1
    })
  }

  componentWillUnmount() {
    if (this.effect) this.effect.destroy()
  }

  render(){
    return(
      <div>
        <nav>
          <p>Nav bar yo</p>
        </nav>
        <div id="my-element">
        </div>
        <h1 className="title">Welcome to the homepage</h1>

        <input type="text" className="search-bar-home"></input>

      <div className="products-homepage"> 
        <h2>Producst section</h2>
      </div>

      </div>
    )
  }
}

export default Homepage
